webpackJsonp([0xc239088e1534],{8351:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"What was Schröder on?",date:"19 Sep 2005",slug:"/2005-09-19-what-was-schrder-on/",tags:"Y2005"},html:'<p><a href="http://www.signandsight.com/features/369.html" title="What was Schr&ouml;der on? - signandsight">signandsight: What was Schr&ouml;der on?</a></p>\n<blockquote><p>There was something surreal about Gerhard Schr&ouml;der\'s appearence on national television last night. Although his party was second in the polls, Schr&ouml;der saw the victory quite clearly as his own. And anyone who saw matters differently, an idiot.</p></blockquote>\n<p><a href="http://chicagokarl.de/2005/09/19/elefanten-runde" title="ChicagoKarl &raquo; Blog Archive &raquo; Elefanten Runde">ChicgoKarl</a> is guessing it was sparking white wine.</p>'},next:{fields:{title:"Before and After",date:"19 Sep 2005",slug:"/2005-09-19-before-and-after/"}},previous:{fields:{title:"Snow Chaos",date:"20 Sep 2005",slug:"/2005-09-20-snow-chaos/"}}},{node:{fields:{title:"Before and After",date:"19 Sep 2005",slug:"/2005-09-19-before-and-after/",tags:"Y2005"},html:'<p><a href="http://www.flickr.com/photos/papascott/44734334/"><img src="http://static.flickr.com/24/44734334_fffbc1e6f1.jpg" width="500" height="375" alt="Before" /></a></p>\n<p>Before</p>\n<p><a href="http://www.flickr.com/photos/papascott/44734604/"><img src="http://static.flickr.com/31/44734604_b022c6b0ef.jpg" width="500" height="375" alt="After" /></a></p>\n<p>After</p>'},next:{fields:{title:"Who's On First?",date:"18 Sep 2005",slug:"/2005-09-18-whos-on-first/"}},previous:{fields:{title:"What was Schröder on?",date:"19 Sep 2005",slug:"/2005-09-19-what-was-schrder-on/"}}},{node:{fields:{title:"Who's On First?",date:"18 Sep 2005",slug:"/2005-09-18-whos-on-first/",tags:"Y2005"},html:'<p>The Union is just 0.8% ahead of the SPD in the latest count, and the media are <a href="http://www.spiegel.de/politik/deutschland/0,1518,375255,00.html" title="Hochrechnungsdrama: Umfrage sieht SPD in F&uuml;hrung - Politik - SPIEGEL ONLINE">speculating</a> that the notorious <a href="http://en.wikipedia.org/wiki/Overhang_seat">overhang seats</a> could give the SPD a majority in the Bundestag. So maybe that\'s why Schr&ouml;der grinning so broadly in the \'elephant round\' in ARD/ZDF (<a href="http://www.tagesschau.de/video/0,1315,OID4766940_RES_NAV_BAB,00.html">video</a>), At AFOE Tobias Schwarz speculates that <a href="http://fistfulofeuros.net/archives/001900.php" title="A Fistful of Euros: Grand coalition under Schr&ouml;der?">Schr&ouml;der may lead a grand coalition</a>, and maybe that\'s not so far fetched.</p>'},next:{fields:{title:"Nobody Wins",date:"18 Sep 2005",slug:"/2005-09-18-nobody-wins/"}},previous:{fields:{title:"Before and After",date:"19 Sep 2005",slug:"/2005-09-19-before-and-after/"}}}],pathPrefix:"",first:!1,last:!1,index:280,pageCount:1101}}}});
